import React from 'react'

function Index({ people, setPerson }) {
    const getPerson = (person)=>{
        setPerson()
    }

    let content = people.map(ele => {
        return <div key={ele.id}>
            <li>{ele.name}</li>
        </div>
    })
    return (
        <div className='app'>
            <h1>Index</h1>
            {people && <ul>
                {content}
            </ul>}
        </div>
    )
}

export default Index
